function selectThemeReply ( msg, type ) {
       $('.canvas-container' ).hide();
       $('#loadingGifCanvas' ).show();
    _jsObject = msg;
    textureName = defaultBackgroundName;
    canvasScale = 1.0;
    customScaleX = 1;
    customScaleY = 1;
    canvas.clear();
    loadCanvas( type );
    setTimeout(function(){
            $('#loadingGifCanvas' ).hide();
            $('.canvas-container' ).show();
    },500);
}
function close_edit_cell ( e ) {
    if($('.ui-cs-supercontainer').has(event.target ).length>0 || event.target.className=='ui-cs-supercontainer' || event.target.id=='curvedTextEdit' || event.target.id=='curvedTextInput' || event.target.id=='applyCurvedText')
                  return;
    if ( ! ($( event.target ).is( '.top_menu *, .top_menu' )) && ! ($( event.target ).is( '#menuBar *, #menuBar' )) && ! ($( event.target ).is( '.canvas-container *, .canvas-container' )) ) {
        if ( typeof(_currentEditPanel) == 'undefined' ) {
            _currentEditPanel = 0;
        }
        if ( _currentEditPanel == 0 ) {
            return;
        }
        else if ( _currentEditPanel == 1 ) {
            setAllButtonsNotActive();
            if ( ! lockFade ) {
                lockFade = true;
                fade( "editCell", 2 );
                _currentEditPanel = 0;
            }
        }
        else if ( _currentEditPanel == 2 ) {
            setAllButtonsNotActive();
            if ( ! lockFade ) {
                lockFade = true;
                fade( "editCell", 2 );
                _currentEditPanel = 0;
            }
        }
        else if ( _currentEditPanel == 3 ) {
            setAllButtonsNotActive();
            if ( ! lockFade ) {
                lockFade = true;
                _currentEditPanel = 1;
                setTimeout( "clickTwicePrecaustion()", 50 );
            }
        }

        if ( _currentEditPanel != 0 ) {
            setButtonActive();
        }

    }
}
function loadBackground () {
    var url;
    if ( typeof(textureName) !== 'undefined') {
        if(typeof canvas.backgroundImage!=='undefined' && canvas.backgroundImage!=null)
            url=canvas.backgroundImage.getSrc();
        else
            url = mediaUrl + "personalization/html5_files/backgrounds/" + textureName;
        canvas.setBackgroundImage( url, function() {
            updateSizeAndPositionBackground();
            canvas.renderAll();
            objectModify = false;
        } );
    }
}
function setTextureModeDim ( textureMode ) {
    textureModeLeft = 0;
    textureModeTop = 0;
    textureModeWidth = 730;
    textureModeHeight = 801;
}
function setTextureMode ( width,height ) {
    textureModeWidth = width;
    textureModeHeight = height;
}
function setTextureModeByNumber ( textureMode ) {
    textureMode = textureMode;
    setTextureModeDim( textureMode );
}
